import React, { useState } from 'react';
import axios from 'axios';
import NavBar from './NavBar';
import './css/meal-recommend.css';
import './css/main.css';

export default function MealRecommendation() {
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');
  const [mealTypes, setMealTypes] = useState([]);
  const [recommendedMeals, setRecommendedMeals] = useState([]);

  const handleCheckboxChange = (type) => {
    setMealTypes((prev) =>
      prev.includes(type) ? prev.filter((t) => t !== type) : [...prev, type]
    );
  };

  const handleRecommend = async () => {
    try {
      const response = await axios.get('http://localhost:8000/recommend', {
        params: {
          start: startDate,
          end: endDate,
          types: mealTypes.join(',')
        }
      });
      setRecommendedMeals(response.data.result); // assumes LLM returns parsed array
    } catch (error) {
      console.error('Ï∂îÏ≤ú Ïã§Ìå®:', error);
    }
  };

  return (
    <>
    <NavBar />
    <div className="recommend-wrapper">
      <div className="recommend-inner">
        <h2 className="title">üìÖ ÎßûÏ∂§ ÏãùÎã® Ï∂îÏ≤ú</h2>

        <div className="filters box">
          <div className="form-group">
            <label className="label">Í∏∞Í∞Ñ ÏÑ†ÌÉù</label>
            <div className="date-range">
              <input type="date" value={startDate} onChange={(e) => setStartDate(e.target.value)} className="date-input" />
              <span className="tilde">~</span>
              <input type="date" value={endDate} onChange={(e) => setEndDate(e.target.value)} className="date-input" />
            </div>
          </div>

          <div className="form-group">
            <label className="label">ÏãùÏÇ¨ ÏÑ†ÌÉù</label>
            <div className="checkbox-group">
              <label><input type="checkbox" value="breakfast" onChange={() => handleCheckboxChange('breakfast')} /> Ï°∞Ïãù</label>
              <label><input type="checkbox" value="lunch" onChange={() => handleCheckboxChange('lunch')} /> Ï§ëÏãù</label>
              <label><input type="checkbox" value="dinner" onChange={() => handleCheckboxChange('dinner')} /> ÏÑùÏãù</label>
            </div>
          </div>

          <button onClick={handleRecommend} className="btn btn-primary">üç± Ï∂îÏ≤ú Î∞õÍ∏∞</button>
        </div>

        <table className="result-table">
          <thead>
            <tr>
              <th>ÎÇ†Ïßú</th>
              <th>ÏãùÏÇ¨Íµ¨Î∂Ñ</th>
              <th>Ï∂îÏ≤úÎ©îÎâ¥</th>
            </tr>
          </thead>
          <tbody>
            {recommendedMeals.map((meal, index) => (
              <tr key={index}>
                <td>{meal.date}</td>
                <td>{meal.type}</td>
                <td>{meal.menu}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
    </>
  );
}
